import logo from './logo.svg';
import me from './assets/jyp.jpg';
import './App.css';

function App() {

  let greeting = "Allo!"

  return (
    <div className="App">
      <div className='introBlock'>
        <p className="intro">
          {greeting}
        </p>
      </div>
      <div className='imgBlock'>
        <img src={me} className="profile" alt="logo" />
      </div>



    </div>
  );
}

export default App;
